import '../../auth/Data.dart';import 'Category.dart';class PostData {  PostData({      this.id,       this.title,       this.description,       this.status,       this.detailsAddress,       this.phone,       this.country,       this.image,       this.idImage,      this.userId,      this.categoryId,       this.startDate,       this.endDate,       this.startTime,       this.endTime,       this.user,       this.category,  });  PostData.fromJson(dynamic json) {    id = json['id'];    title = json['title'];    idImage = json['id_image'];    description = json['description'];    status = json['status'];    detailsAddress = json['details_address'];    phone = json['phone'];    country = json['country'];    image = json['image'];    userId = json['user_id'];    categoryId = json['category_id'];    startDate = json['start_date'];    endDate = json['end_date'];    startTime = json['start_time'];    endTime = json['end_time'];    user = json['user'] != null ? UserData.fromJson(json['user']) : null;    category = json['category'] != null ? Category.fromJson(json['category']) : null;  }  int? id;  String ?title;  String? description;  String? status;  String? detailsAddress;  String ?phone;  String? country;  String ?image;  String ?idImage;  int? userId;  int? categoryId;  String? startDate;  String? endDate;  String? startTime;  String? endTime;  UserData ?user;  Category? category;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['title'] = title;    map['description'] = description;    map['status'] = status;    map['id_image'] = idImage;    map['details_address'] = detailsAddress;    map['phone'] = phone;    map['country'] = country;    map['image'] = image;    map['user_id'] = userId;    map['category_id'] = categoryId;    map['start_date'] = startDate;    map['end_date'] = endDate;    map['start_time'] = startTime;    map['end_time'] = endTime;    if (user != null) {      map['user'] = user!.toJson();    }    if (category != null) {      map['category'] = category!.toJson();    }    return map;  }}